#sign-up-page {
  form.sign-up-form {
    width: 70%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    gap: 2rem;
    margin: 2.5rem 0;

    .input-group {
      display: flex;
      flex-direction: column;
      gap: .4rem;
      width: 100%;
    }

    .message-box {
      margin-bottom: 1rem;
    }
  }

  .already-have-account {
    font-size: 1.1rem;
    color: $black_color;
  }
}
